// import EasyPurchases from './EasyPurchases';
import LiveChat from './LiveChat';
// import GetStarted from './GetStarted';

class MarketingSite extends Component {
    state = {
        loggedIn: false
    };
    render() {
        return (
            <div>
                <NavBar/>
                <Intro/>
                <PopularPins/>
                <Quizzes/>
                {/* <EasyPurchases/> */}
                <LiveChat/>
                <GetStarted/>
            </div>
        );
    }
}

export default MarketingSite;
